import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Home extends Component {
  render() {
    return (
      <div>
        <h1 align="center">Home Page</h1>
        <h2 align="Register">
          {" "}
          <Link to="/register">Register</Link>/
        </h2>
      </div>
    );
  }
}
